import React from 'react'
import s from './todo.module.css'
import Todoitem from './todoItem'

const Todo = (props) => {
	return (
		<div className={s.container_todo}>
			<ul>
				<Todoitem />
			</ul>
		</div>
	)
}

export default Todo
